import Blog from "../../components/blog";
import FouthSelection from "./section/FouthSelection";
import FifthSection from "./section/FifthSection";



const Main = (props)=>{

  return(
    <div>
      <Header/>
      <FirstSection/>
      <SecondSection/>
      <ThirdSelection/>
      <FouthSelection/>
      <FifthSection/>
    </div>  
  )
}

export default Main;
